   crc32CheckCommand  = "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",   "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c",     "k%2i%2o%2c"
