[VeAnalyze]
    ;    tableName,  lambdaTargetTableName, lambdaChannel, egoCorrectionChannel, activeCondition

     veAnalyzeMap = FuelTable, LambdaTable, Lambda_1, Lambda_Correction, { (rpm > 250) }

       ; filter =  Name,        "DisplayName", outputChannel, operator, defaultVal, userAdjustable
         filter = minRPMFilter, "Minimum RPM", rpm,           <       , 500,      , true
         filter = maxRPMFilter, "Maximum RPM", rpm,           >       , 24000,    , true

         filter = std_xAxisMin ; Auto build with appropriate axis channels
         filter = std_xAxisMax ; Auto build with appropriate axis channels
         filter = std_yAxisMin ; Auto build with appropriate axis channels
         filter = std_yAxisMax ; Auto build with appropriate axis channels
         filter = std_DeadLambda ; Auto build

         ; enable these if you have 0 based fueling table instead of 100 based.
         zAxisTransform = 100;
         option = disableMaxPercentLimit


         ; make sure it's in steady state and transient corrections are off
         filter = Accel_Decel_Corr_on,   "Accel/Decel Corrction",           Accel_Decel_Corr,      >   , 0  , true
         filter = warm_up_Corr_on,       "Warm-up Corrction",               Prime_Corr,            >   , 0  , true
         filter = Fuel_Temp_Corr_on,     "Fuel v coolant Temp Corrction",   Fuel_Temp_Corr,        >   , 0  , true



